Open_CareRequests_1.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q = filter q by 'Case_IsClosed' == "false";
q_B = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_new_1.selection, 0, "Text2").asString()}}];
q_C = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_new_1.selection, 0, "Text3").asString()}}];
result = group q by all full, q_B by all full, q_C by all;
result = foreach result generate unique(q.'Id') as 'Total_CareRequests', unique(q_B.'Id') as 'LastDays_CareRequests', unique(q_C.'Id') as 'LastPreviousDays_CareRequests';
result = foreach result generate 'Total_CareRequests', 'LastDays_CareRequests', 'LastPreviousDays_CareRequests', ('LastDays_CareRequests'-'LastPreviousDays_CareRequests')/'LastPreviousDays_CareRequests' as 'Percentage_Change_In_CareRequest';

